import React, { Component } from "react";
import { Chart } from "react-google-charts";

export default class BarCha extends Component {
  render() {
    return (
      <Chart
        chartType="Bar"
        width="80%"
        height="400px"
        data={data}
        options={options}
      />
    );
  }
}
